var title_f23_62_24549="Ventilatory effects of SNOs";
var content_f23_62_24549=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F70886&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F70886&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 498px\">",
"   <div class=\"ttl\">",
"    How S-nitrosothiols (SNOs) work on the brainstem to control breathing",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 478px; height: 251px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (a) Haemoglobin is oxygenated in the lungs; one of its cysteine residues is then modified with SNO. (b) Oxygen levels in the brain (and other peripheral tissues) are lower than in blood. Haemoglobin releases its oxygen and changes its shape in a way that ultimately promotes transfer of its NO group to another cysteine residue, in this case on glutathione (c), by transnitrosylation. S-nitrosoglutathione is cleaved by the enzyme gamma-glutamyl transpeptidase in neuronal tissue to form S-nitrosocysteinyl glycine. It is also possible that S-nitrosocysteinyl glycine is then cleaved by a peptidase to produce S-nitroso-L-cysteine. One of these two molecules is then proposed to transnitrosylate a cysteine residue in a target protein in the nucleus tractus solitarius region of the brainstem, regulating the central neuronal circuitry that controls breathing.",
"    <div class=\"footnotes\">",
"     SNO: S-nitrosothiols; O",
"     <sub>",
"      2",
"     </sub>",
"     : oxygen; NO: nitric oxide.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Lipton SA. Physiology: Nitric oxide and respiration. Nature 2001; 413:118. Copyright &copy; 2001 Nature.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
