var title_f23_62_24558="Coagulation pathways";
var content_f23_62_24558=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F79998&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F79998&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Intrinsic, extrinsic, and common coagulation pathways",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 446px; height: 364px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic representation of the intrinsic (in red), extrinsic (in blue), and common (in green) coagulation pathways. In the clinical laboratory, the intrinsic (and common) pathway is assessed by the activated partial thromboplastin time (aPTT) and the extrinsic (and common) pathway by the prothrombin time (PT). The thrombin time (TT) assesses the final step in the common pathway, the conversion of fibrinogen to fibrin, following the addition of exogenous thrombin. Fibrin is crosslinked through the action of factor XIII, making the final fibrin clot insoluble in 5 Molar urea or monochloroacetic acid. This latter function is not tested by the PT, aPTT, or TT.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
